    true,nt"url": null,nt"notes": "The Former Prisoner of War (POW) Statistical
    Tracking System database is a registry designed to comply with Public Law 97-37,
    the Former Prisoner of War Benefits Act of 1981. This database contains information
    about the Medical Evaluation Program for ex-POWs at VA facilities. The program provides
    a complete medical and psychiatric evaluation of ex-POWs. Only ex-POWs who volunteer
    to participate in the program are included in this registry. Health examinations
    are given to ex-POWs at VA facilities. The findings are then recorded on a special
    coding sheet, VA Form 10-0048a. Quarterly, these code sheets are sent to the Austin
    Information Technology Center, where they are manually keyed into the database.
    The main users of this registry are: * The Advisory Committee on Former Prisoners
    of War * Congress * National Academy of Sciences * Researchers * The National Center
    for Veteran Analysis and Statistics.",nt"license_title": "Creative Commons
